使用typescript和storybook开发react组件库
1.脚手架
1.初始化

创建git repository
npm init
mkdir src，src作为源码路径

2.安装和配置react, typescript

yarn add typescript react @types/react -D
创建tsconfig.json, outDir为输出路径

{
  "compilerOptions": {
    "sourceMap": true,
    "target": "es6",
    "jsx": "react",
    "declaration": true,
    "outDir": "lib",
    "moduleResolution": "node",
  },
  "include": [
    "src"
  ]
}


修改package.json

{
  //...
  "scripts": {
    //...
    "build": "tsc -p .",
    "start": "npm run build -- -w",
    //...
  },
  // ...
}

3.安装和配置storybook, jest

install

npx -p @storybook/cli sb init --type react
yarn add -D awesome-typescript-loader
yarn add -D @storybook/addon-info react-docgen-typescript-loader # optional but recommended
yarn add -D jest "@types/jest" ts-jest #testing


在.storybook目录下增加webpack.config.js文件

module.exports = ({ config }) => {
config.module.rules.push({
  test: /\.(ts|tsx)$/,
  use: [
    {
      loader: require.resolve('awesome-typescript-loader'),
    },
    // Optional
    {
      loader: require.resolve('react-docgen-typescript-loader'),
    },
  ],
});
config.resolve.extensions.push('.ts', '.tsx');
return config;
};


更改.storybook/config.js, 使用addon-info

import { configure, addDecorator } from '@storybook/react';
import { withInfo } from '@storybook/addon-info';

addDecorator(withInfo); 

// automatically import all files ending in *.stories.js
configure(require.context('../stories', true, /\.stories\.js$/), module);


yarn ts-jest config:init


修改package.json

{
  //...
  "scripts": {
    //...
    "test": "jest",
    //...
  },
  // ...
}

4. 使用storybook插件

安装notes 和 source

yarn add @storybook/addon-notes @storybook/addon-storysource


更改.storybook/addons.js

import '@storybook/addon-storysource/register';
import '@storybook/addon-notes/register-panel';


更改.storybook/webpack.config.js，配置addon source

module.exports = ({ config }) => {
  config.module.rules.push({
    test: /\.(ts|tsx)$/,
    use: [
      {
        loader: require.resolve('awesome-typescript-loader'),
      },
      // Optional
      {
        loader: require.resolve('react-docgen-typescript-loader'),
      },
    ],
  });
  config.resolve.extensions.push('.ts', '.tsx');

// ++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++
  config.module.rules.push({
    test: /\.stories\.js?$/,
    loaders: [
      {
        loader: require.resolve('@storybook/source-loader'),
        options: { parser: 'typescript' },
      },
    ],
    enforce: 'pre',
  });
// ++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++

  return config;
};

5.使用typedoc

yarn add -D typedoc typedoc-plugin-markdown
修改package.json

{
  //...
  "scripts": {
    //...
    "doc": "npx typedoc --plugin typedoc-plugin-markdown --out typedocs src"
    //...
  },
  // ...
}

2. 开发
1. src下除index.ts的每个文件或目录代表一个组件
2. src/index.ts 导出所有组件
3. 每个组件有自己的测试目录test
3. 测试
1. 测试自定义hooks

